window.bookSummaryJSON = "<p><b>From the greatest names in fantasy and horror comes an anthology of stories inspired by&nbsp;</b><b><i>Alice's Adventures in Wonderland</i></b><b>.</b></p> <p>Join Alice as she is thrown into the whirlwind of Wonderland.</p> <p>Within this audiobook, you'll find myriad approaches to Alice, from horror to historical, taking us from the nightmarish reaches of the imagination to tales that will shock, surprise, and tug on the heart-strings. So, it's time now to go down the rabbit hole, or through the looking-glass or...but no, wait. By picking up this audiobook and starting to listen to it, you're already there, can't you see?</p>"; 
